import React from "react";
import Wheel from "./wheel";
const Roulette = () => {

    let Container = `
        display: flex;
        justify-content: center;
        align-items: center;
        margin-top: 200px;
    `
    return(
        <Container>
            <h1>Roulette</h1>
            <Wheel/>
        </Container>
    )
}

export default Roulette;
